import numpy as np

def submatrix_with_n_numbers(matrix):
    count = 0
    rows, cols = len(matrix), len(matrix[0])
    for i in range(rows):
        for j in range(cols):
            if i+1 < rows and j+1 < cols:
                submatrix = matrix[i:i+2, j:j+2]
                if np.sum(submatrix) == 94:
                    count += 1
    return count
